import React from 'react';
import {Text, View, Pressable} from 'react-native';


const StyledButton = (props) =>{
    return(
    <View>
        <Pressable 
            style={styles.button}
            onPress={() => {
             console.warn("Hey There");
        }}>



        </Pressable>
    </View>
    );
};

export default StyledButton;
